Information
------------------------------

This History Channel series, hosted by Prince Andrew, Duke of York, explores the dramatic rise and decline of British naval power over the last 500 years. Since its creation under orders of King Henry VIII, the Royal Navy heralded Britain's emergence as a global superpower, presiding over what was the largest colonial empire in world history. This documentary series explores the evolution of British sea power from wooden galleons and ships-of-the-line, through to ironclad dreadnoughts and modern aircraft carriers. 
Discover how the Royal Navy was created during the reign of King Henry VIII, travel with Sir Francis Drake aboard his famous ship Golden Hinde in 1577, admire Admiral Nelson's triumph at the Battle of Trafalgar in 1805 and learn why so many illustrious ships were decommissioned at the end of the Falklands War.

Produced by Perpetual Motion Films for The History Channel

1)  The King's Ships 1500-1599 
In an exciting miniseries exploring the dramatic rise and decline of English naval power, host Prince Andrew, Duke of York, examines Britannia's rule of the seas in 16th century.
The story begins with the creation of a Royal Navy under orders of the powerful King Henry VIII with ships such as GREAT HARRY and the MARY ROSE.
We follow the daring exploits of Sir Francis Drake's GOLDEN HINDE and the revolutionary innovations of John Hawkins' race-built Galleons - the backbone of Elizabethan naval power during the Age of Discovery. Finally the climatic showdown with Spain's Invincible Armada in 1588 laid the groundwork for the dramatic rise of English naval power and Britannia's Rule of the Seas in the years to come.

